@Fenrir 44 It really is hard to argue against white supremacy when the entire establishment enables their anarchistic behavior. I hear it was never like this before the 70's or so. But that was way before I was ever alive.

We really need to consider these optics. Black people rioting across the country. Black politicians giving speeches saying QUOTE "This is not a riot. This is a revolution." All the while white male gamers like me are blamed because were at home playing video games and having a great time. Meanwhile when we emerge from our jobless hobbit holes for the bi weekly supply rations, suddenly somehow the entire country is in nearly full lawlessness.

What the fuck over?

@Ez miez dragged him out, yes. Sacrifice career, yes. Killed him, yes but I dont believe that was their intent. I really dont. Maybe, maybe it was, but it appears to me, as I saw it, to have been a cop on a power trip. Using excessive restraint methods for a man who was having a hard time walking.

On top of that, I understand that restraining someone 1v1 is actually more difficult that some people realise, but it was 1v4 and two people kneeling on his arms or shoulders would have restrained him and [most likely]  not resulted in his death.
It really just seems like a cop with a power trip that went too far.
